import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-quartz.css';
import { AgGridReact } from 'ag-grid-react';
import React, { useEffect, useMemo, useState } from 'react';
//import { createRoot } from 'react-dom/client';
import Button from 'react-bootstrap/Button';
import axios from 'axios';

/* Format Date Cells */
const dateFormatter = (params) => {
  return new Date(params.value).toLocaleDateString('en-us', {
    weekday: 'long',
    year: 'numeric',
    month: 'short',
    day: 'numeric',
  });
};
// Create new GridExample component
const GridExample = () => {
  // Row Data: The data to be displayed.
  const [rowData, setRowData] = useState([]);

  // Column Definitions: Defines & controls grid columns.
  const [colDefs] = useState([

    {headerName:'display_OrderId', field: 'displayOrderId', width:'100px' },
    {headerName:'customer_Name', field: 'customerName', width:'100px' },
    {headerName:'product_Name', field: 'productName', width:'100px' },
    {headerName:'customer_Name', field: 'customerName', width:'100px' },
    {headerName:'mobile_No', field: 'mobileNo', width:'100px' },
    {headerName:'model_No', field: 'modelNo' , width:'100px' },
   // {headerName:'Product_Color', field: 'ProductColor', width:'100px' },
    {headerName:'category', field: 'category', width:'100px' },
    {headerName:'sub_Category', field: 'subCategory', width:'100px' },
    {headerName:'discription', field: 'discription', width:'100px' },
    {headerName:'order_Date', field: 'orderDate', width:'100px' },
    {headerName:'expected_Delivery_Date', field: 'expectedDeliveryDate' , width:'100px' },
    {headerName:'logistic_Name', field: 'logisticName' , width:'100px' },
    {headerName:'awbNo', field: 'awbNo' , width:'100px' },
    {headerName:'coupon_Code', field: 'couponCode' , width:'100px' },
    {headerName:"Action", field: "displayOrderId",
    cellRenderer:(params)=><div>
       <Button variant="primary">Edit</Button>
       {/* <Button variant="danger" onClick={deletehandler(displayOrderId)}>Delete</Button> */}
    </div>, width:'100px' },
  ]);

  const getOrders = async () => {
    const result = await axios.get('http://localhost:8080/getcustomerorders')
    console.log(result.data);  
    setRowData(result.data);
  };

  useEffect(() => { 
    getOrders();
  }, []);

//   const deletehandler = async(displayOrderId)=>{
//     await axios.delete(`http://localhost:8080/deleteorder/${displayOrderId}`)
//     getOrders();

// }

  // Apply settings across all columns
  const defaultColDef = useMemo(() => ({
    filter: true,
    editable: true,
  }), []);

  // Container: Defines the grid's theme & dimensions.
  return (
    <div className={"ag-theme-quartz" } style={{ width: '1800px', height: '500px', margin:'10px' }}
    >
      <Button variant="primary" style={{ "postion": "right-top" }}>Primary</Button>
      <AgGridReact
        rowData={rowData}
        columnDefs={colDefs}
        defaultColDef={defaultColDef}
        pagination={true}
        rowSelection="multiple"
      />

    </div>
  );
};
export default GridExample;
